const Select = props => {
  const mappedData = data => {
    data.map(value => (
      <option key={value} id={value} value={value}>
        {value}
      </option>
    ));
  };

  return (
    <div className={props.className}>
      <label>{props.labelName}</label>
      <br />
      <select onChange={props.onChange} onBlur={props.onBlur}>
        {mappedData}
      </select>
    </div>
  );
};

export default Select;
